import React, { Component } from 'react';
import styled from 'styled-components';

import Board from './components/Board';
import Symbol from './components/Symbol';
import ImageLoader from './lib/ImageLoader';

const Symbols = styled.div`
  position: absolute;
  top: 50px;
  left: 800px;
  width: 50px;
  display: block;
  margin-left: auto;
  margin-right: auto;
`;

const Box = styled.div`
  position: absolute;
  top: 50px;
  left: 50px;
  width: 100px;
  height: 100px;
  border: solid;
`

class App extends Component {
  render() {
    let symbols = [];

    for(let key in ImageLoader) {
      symbols.push(<Symbol image={ImageLoader[key]} />)
    }

    return (

      <Box onMouseDown={this.handleDown}>

      </Box>
    );
  }
}

/*

        <Symbols>
          {symbols}
        </Symbols>
        <Board row={15} col={20}/>
        */

export default App;
